import './Filme.css';

const filmes = [{
    'nome': 'Vingadores',
    'duracao': '2H30',
    'foto': 'Vingadores.jpg',
},
{
    'nome': 'Vingadores2',
    'duracao': '2H00',
    'foto': 'Vingadores.jpg',
},
{
    'nome': 'Vingadores3',
    'duracao': '2H40',
    'foto': 'Vingadores.jpg',
}
]

export default function Filme() {
    return (
        <div className='conteiner-fluid text-center'>
            <div class='row'>
                {filmes.map((filme, i) => (
                    <div className='col' key={i.toString()}>
                        <div className='card'>
                            <img src={filme.foto} alt="Vingadores" />
                            <div className='card-body'>
                                <h5 className='card-title'>{filme.nome}</h5>
                                <p>Duração: {filme.duracao}</p>
                                <a href={`detalhes/${filme.nome}`}>
                                    <div className='btn btn-primary'>
                                        Detalhes
                                    </div>
                                </a>
                            </div>
                        </div>
                    </div>

                ))}
            </div>
        </div>
    )

}
